//////////////////////////////FUNCTIONS///////////////////////////////

template <typename T>
inline void swap_(T &x, T &y) { T z = y; y = x; x = z; }

template <typename T>
inline T min_(const T &x, const T &y) { return x < y? x: y; }

template <typename T>
inline T max_(const T &x, const T &y) { return x > y? x: y; }

inline int minint_(const int &x, const int &y)
{
    long long m = (x - y) >> 31;
    return (y & ~m) | (x & m);
}

inline int maxint_(const int &x, const int &y)
{
    long long m = (x - y) >> 31;
    return (y & m) | (x & ~m);
}

inline void bitsSwap5(ull &x, ui i, ui j)
{
    ull a = ((x >> i) & 0x1FULL) << j;
    ull b = ((x >> j) & 0x1FULL) << i;
    x = (x & ~(0x1FULL << i)) | b;
    x = (x & ~(0x1FULL << j)) | a;
}

